INSERT INTO `file` VALUES (189, 'upload/frontviewhousemiloandrus.jpg', 'upload/thumbs/frontviewhousemiloandrus thumbnail.jpg', 'upload/view/frontviewhousemiloandrus view.jpg', 'Halfway House 1', NULL, 'This home, called the halfway house, rested in the grove of trees just south of the Old Navy and Barnes and Noble Stores at about 10000 S. State Street. There is a plaque at the location now in the grove of trees. The home was then moved and now has been restored and can be found at the Pioneer Heritage Park in Salt Lake City,  and serves as the General Store there.  This comes from Laura Anderson''s collection.', '2013-10-07 22:00:11', 'image');
