INSERT INTO `file` VALUES (241, 'upload/robertandheberandrus.jpg', 'upload/thumbs/robertandheberandrus thumbnail.jpg', 'upload/view/robertandheberandrus view.jpg', 'Robert and Heber Andrus', NULL, 'Robert and Heber Andrus photo from Rich Andrus'' collection.', '2013-11-01 10:04:50', 'image');
INSERT INTO `file` VALUES (242, 'upload/robertandrusandloveniabawdenfamilyyoung.jpg', 'upload/thumbs/robertandrusandloveniabawdenfamilyyoung thumbnail.jpg', 'upload/view/robertandrusandloveniabawdenfamilyyoung view.jpg', 'Robert and Lovenia Andrus Family 1908', NULL, 'This photo was taken in 1908. Robert is holding Sarah, Lovenia is holding Rula, Minnie stands in the middle with Howard and Grant standing in back and Reed sitting up front. Wiggly children did create blury photos. This photo comes from Caroline Mackay''s collection.', '2013-11-01 10:08:01', 'image');
INSERT INTO `file` VALUES (243, 'upload/sundaybestfamilyrobertandrus.jpg', 'upload/thumbs/sundaybestfamilyrobertandrus thumbnail.jpg', 'upload/view/sundaybestfamilyrobertandrus view.jpg', 'Sunday Best Robert Andrus Family Photo', NULL, 'Robert and Lovenia Andrus Family in their Sunday Best: Back Row: baby, Grant, May Walker, Rula, Robert, Lovenia, Minnie, Elva Lovina Dixon (Dot), Howard. Front Row: Reed, Inez, Sarah, Tom, Beulah, Vera. This photo is from Caroline Mackay''s collection.', '2013-11-01 10:19:56', 'image');
INSERT INTO `file` VALUES (244, 'upload/swimmingrobertandrus.jpg', 'upload/thumbs/swimmingrobertandrus thumbnail.jpg', 'upload/view/swimmingrobertandrus view.jpg', 'Swimming Fun Robert Andrus Family', NULL, 'Robert Andrus and Lovenia Bawden Andrus family enjoying a swimming pool trip. From Left: Elva Lovina Dixon (Dot) Howard, Sarah (behind) Inez with Reed behind, Tom in Front, Robert and Lovenia behind. Beulah in front, Rula and Vera. This photo is from Caroline Simmons Mackay''s collection.', '2013-11-01 10:23:04', 'image');
INSERT INTO `file` VALUES (245, 'upload/weddingrobertandruslovenia.jpg', 'upload/thumbs/weddingrobertandruslovenia thumbnail.jpg', 'upload/view/weddingrobertandruslovenia view.jpg', '1895 Wedding Robert and Lovenia Andrus', NULL, '1895 Wedding photo for Robert Andrus and Lovenia Evelyn Bawden.  This comes from Sarah Jane Andrus'' collection.', '2013-11-01 10:25:40', 'image');
INSERT INTO `file` VALUES (246, 'upload/fireplace robert andrus home cm.jpg', 'upload/thumbs/fireplace robert andrus home cm thumbnail.jpg', 'upload/view/fireplace robert andrus home cm view.jpg', 'Fireplace', NULL, 'The fireplace in Robert and Lovenia Andrus'' home in Ucon, Idaho.  This comes from Caroline Mackay''s collection.', '2013-11-01 10:27:20', 'image');
INSERT INTO `file` VALUES (247, 'upload/oldcabinandnewhouserobertandrus.jpg', 'upload/thumbs/oldcabinandnewhouserobertandrus thumbnail.jpg', 'upload/view/oldcabinandnewhouserobertandrus view.jpg', 'Old Andrus Cabin', NULL, 'Robert and Lovenia Andrus cabin with their new home in the background.  Sarah Jane Andrus collection.', '2013-11-01 10:28:52', 'image');
INSERT INTO `file` VALUES (248, 'upload/1oldcabinandnewhouserobertandrus.jpg', 'upload/thumbs/1oldcabinandnewhouserobertandrus thumbnail.jpg', 'upload/view/1oldcabinandnewhouserobertandrus view.jpg', 'Old Andrus Cabin with notes', NULL, 'This is the old cabin where Lovenia Evelyn Bawden and Robert Andrus had most of their children. After serving a mission, Robert Andrus built a new house that is in the background. Both of these were located in Willow Creek or Ucon, Bonneville, Idaho. This comes from Rich Andrus'' collection.', '2013-11-01 10:31:47', 'image');
INSERT INTO `file` VALUES (249, 'upload/reedandmelbaandrusinfrontofhouse.jpg', 'upload/thumbs/reedandmelbaandrusinfrontofhouse thumbnail.jpg', 'upload/view/reedandmelbaandrusinfrontofhouse view.jpg', 'Reed and Melba in front of Robert Andrus home', NULL, 'This photo has been mislabeled.  The two people in this photo are Reed and Melba Andrus.  This is the Robert Andrus family home in the background.  The photo comes from Rich Andrus'' collection', '2013-11-01 10:34:53', 'image');
INSERT INTO `file` VALUES (250, 'upload/robert andrus house and water tower.jpg', 'upload/thumbs/robert andrus house and water tower thumbnail.jpg', 'upload/view/robert andrus house and water tower view.jpg', 'Robert Andrus Home and Water Tower', NULL, 'Robert and Lovenia Andrus home with the water tower showing in the background.  This photo likely came from Caroline Mackay''s collection.', '2013-11-01 10:36:34', 'image');
INSERT INTO `file` VALUES (251, 'upload/robertandrushome.jpg', 'upload/thumbs/robertandrushome thumbnail.jpg', 'upload/view/robertandrushome view.jpg', 'Robert Andrus Home', NULL, 'This home was built by Robert Andrus and it is the place that the family was raised after it was built. It is probably Robert Andrus and Lovenia and some of their children that are standing in front of the home, but it is not certain.  This photo comes from Rich Andrus'' collection.', '2013-11-01 10:38:08', 'image');
