INSERT INTO `file` VALUES (254, 'upload/complete life history.html', 'changeMeToDocThumb', NULL, 'Robert Andrus Life Story', 'Robert Andrus, Sarah Jane Andrus, Beulah Leona Andrus', 'Life story dictated by Robert Andrus to his daughters Sarah Jane Andrus and Beula Andrus.  They also have added a few notes on things as well outside of what he said. This history comes to us from Caroline Mackay''s Collection.', '2013-11-01 11:21:41', 'document');
