INSERT INTO `file` VALUES (338, 'upload/ucon ward photo 1945.jpg', 'upload/thumbs/ucon ward photo 1945 thumbnail.jpg', 'upload/view/ucon ward photo 1945 view.jpg', 'Ucon Ward 1945', NULL, 'Ucon Ward Photo from 1945.  This photo was mislabeled as an Andrus Family Reunion, but Stephen Simmons, who lived in Ucon at the time, can label many of the people and has determined that they are from all the Ucon Families.  I cannot label the photo, but I know these people are in it.  Another file will have a map for what I can show you.  Beulah and Ed Beutler, Reed, Howard, Minnie, Grant, Sarah, all Andruses.  Jack Phillips, May Walker, Kathleen Phillips, Caroline, Rulon, and Stephen Simmons and their father Rulon Simmons, Rich and Portia Andrus, Aunt Lizzie(Bawden?)  Stephen called her Aunt.  Patty, Sharon, Larry, Valene, Kendell, Robert, Annie, Doug, Todd and their wives, Lovenia Evelyn Bawden Andrus, Garda and Tom Andrus.', '2014-01-20 14:30:45', 'image');
