INSERT INTO `file` VALUES (436, 'upload/willowcreekgroup.jpg', 'upload/thumbs/willowcreekgroup thumbnail.jpg', 'upload/view/willowcreekgroup view.jpg', 'Willow Creek Harvest.', 'Rulon Lee Simmons Collection', 'Harvesting in Willow Creek. Alphonzo Bert Simmons standing. Lee Robinson & wife Annie Petersen on wagon with their baby son Oliver L Robinson.  Children are Mary Ann Simmons, Lucy Ann Simmons and Elmer B. Simmons.  Alice Simmons is on the haystack.  The log house belonged to Amos Robinson and was the first home of Alphonzo Bert Simmons.  He later build another cabin about in the center of this picture.  The log cabin was where the Willow Creek Ward was organized in 1888 with Alphonzo Bert Simmons as the first bishop.', '2014-07-30 21:42:49', 'image');
INSERT INTO `file` VALUES (437, 'upload/alphonzohebermaryannierosellasimmons.jpg', 'upload/thumbs/alphonzohebermaryannierosellasimmons thumbnail.jpg', 'upload/view/alphonzohebermaryannierosellasimmons view.jpg', 'Alphonzo Bert Simmons and home.', 'Rulon Lee Simmons Collection', 'Alphonzo Bert Simmons standing in front of his new home in Ucon, Idaho.  Teh house was just east of the Farmers Friend Canal in east Ucon.  It faced west.  The children are Heber Simmons, Mary Fretwell, Annie (Bannie) Starkey, and Rosella Fretwell.', '2014-07-30 21:48:55', 'image');
