INSERT INTO `file` VALUES (697, 'upload/Campbell Viola and the Jameston Ward Relief Society Presiden.jpg', 'upload/thumbs/Campbell Viola and the Jameston Ward Relief Society Presiden thumbnail.jpg', 'upload/view/Campbell Viola and the Jameston Ward Relief Society Presiden view.jpg', 'Former Relief Society Presidents of the Jameston Ward, Shelley, ID stake.', 'Viola Campbell Collection', 'This is a picture of the the Former Relief Society Presidents of the Jameston Ward from 1908 to 1954, part of the original Shelley, ID stake.  Elinora Arave Cox (1908-1917), Amanda Christensen (1917-1919), Elizabeth Burke (1919-1935), Ethel Fielding (1935-?) she died while in office.  Mable Roberts (19?-1935), Ardella Parks (1943-1945), Dorothy Fielding (1945-1948), Lillie Cook (1948-1950), Vella Mecham (1950-1953), Viola Hillman (1953-1954) ', '2014-09-04 13:26:17', 'image');
